import HabitTracker from './components/HabitTracker';
import './styles/App.css';

function App() {
    return (
        <div className="dashboard-grid">
            <div className="profile">Profile</div>
            <div className="calendar">
                <h3>Calendar</h3>
                <Calendar />
            </div>
            <div className="sidebar">Pet</div>
            <div className="todo">
                <h3>To-do</h3>
                <TodoList />
            </div>
            <div className="reminders">
                <h3>Reminders</h3>
                <Reminders />
            </div>
            <div className="habit">
                <h3>Habit Tracker</h3>
                <HabitTracker />
            </div>
        </div>
    );
}

export default App;
